import axios from "./axios";


export class ApiList {

  public login(obj: any) {
    let fd: any = new FormData();
    Object.keys(obj).map((item: any) => {
      fd.append(item, obj[item])
    })
    axios.defaults.headers.post['Content-Type'] = 'application/x-www-form-urlencoded';
    let params: any = {
      url: `/merchant/login`,
      method: "POST",
      data: fd
    };
    return axios(params);
  }

  public logOut(obj: any) {
    let params: any = {
      url: `/merchant/logout`,
      method: "POST",
      dataType: "json",
      data: obj
    };
    return axios(params);
  }

  public addBankCark(obj: any) {
    let params: any = {
      url: `/merchant/bankadd`,
      method: "POST",
      dataType: "json",
      data: obj
    };
    return axios(params);
  }

  public handleTableData(url: any, obj: any) {
    let params: any = {
      url: url,
      method: "POST",
      dataType: "json",
      data: obj
    };
    return axios(params);
  }

  changePass(url: any, obj: any) {
    let params: any = {
      url: url,
      method: "POST",
      dataType: "json",
      data: obj
    };
    return axios(params);
  }

  public getUserInfo() {
    // Object.keys(obj).map((item: any) => {
    //   url += item + '=' + obj[item] + '&'
    // })
    let params: any = {
      url: `/merchant/userquery`,
      method: "GET",
    }
     return axios(params);  
  }

   public depositlist(url: any, obj: any) {
     Object.keys(obj).map((item: any) => {
       url += item + '=' + obj[item] + '&'
     })
    let params: any = {
      url: url,
      method: "GET",
    }
      return axios(params);  
  }


  public statistics(obj: any) {
    let params: any = {
      url: `/merchant/statistics?totime=${obj.totime}`,
      method: "GET",
    }
      return axios(params);

  }
  //注册
  public register(obj: any) {
    let params: any = {
      url: `/merchant/register`,
      method: "POST",
      dataType: "json",
      data: obj
    };
    return axios(params);
  }
  //下发卡列表
  public getcardList(obj: any) {
    let params: any = {
      url: `/merchant/withdrawbank`,
      method: "GET",      
    };
    return axios(params);
  }
  //查看余额
  public seeBalance(obj: any) {
    let params: any = {
      url: `/merchant/balance`,
      method: "GET",      
    };
    return axios(params);
  }
  //提现下发
  public withdraw(obj: any) {
    let params: any = {
      url: `/merchant/withdraw`,
      method: "POST",
      dataType: "json",
      data: obj     
    };
    return axios(params);
  }
}
